CREATE TABLE IF NOT EXISTS `Patrons` (
	`FirstName`	TEXT,
	`LastName`	TEXT,
	`Email`	TEXT,
	`PatronID`	INTEGER
);

CREATE TABLE IF NOT EXISTS `Books` (
	`BookID`	INTEGER NOT NULL,
	`Title`	TEXT,
	`Author`	TEXT,
	`Published`	INTEGER,
	`Barcode`	BIGINT UNSIGNED UNIQUE
);

CREATE TABLE IF NOT EXISTS `Loans` (
	`LoanID`	INTEGER,
	`BookID`	INTEGER,
	`PatronID`	INTEGER,
	`LoanDate`	TEXT,
	`DueDate`	TEXT,
	`ReturnedDate`	TEXT
);







ALTER TABLE `Patrons`
  ADD PRIMARY KEY (`PatronID`);


ALTER TABLE `Books`
  ADD PRIMARY KEY (`BookID`);


ALTER TABLE `Loans`
  ADD PRIMARY KEY (`LoanID`),
  ADD KEY `BookID` (`BookID`),
  ADD KEY `PatronID` (`PatronID`);


ALTER TABLE `Patrons`
  MODIFY `PatronID` INTEGER NOT NULL AUTO_INCREMENT;


ALTER TABLE `Books`
  MODIFY `BookID` INTEGER NOT NULL AUTO_INCREMENT;


ALTER TABLE `Loans`
  MODIFY `LoanID` INTEGER NOT NULL AUTO_INCREMENT;


ALTER TABLE `Loans`
  ADD CONSTRAINT `loans_ibfk_1` FOREIGN KEY (`PatronID`) REFERENCES `Patrons` (`PatronID`),
  ADD CONSTRAINT `loans_ibfk_2` FOREIGN KEY (`BookID`) REFERENCES `Books` (`BookID`);